                <button className="nav_container_one_button">Home</button>
                <button className="nav_container_one_button">Login</button>
                <button className="nav_container_one_button">SignUp</button>
                <button className="nav_container_one_button">Contact</button>
                <button className="nav_container_one_button">About</button>
            </div>
            {/* <img src={require("./home")} alt='logo' /> */}
        </div>
    )
}
